import React from 'react';
import Card from './Card';
function CardList(props) {
    const cardComponent = props.robots.map((user)=> {
        return (
            <Card 
                key={user.id} 
                id={user.id} 
                name={user.name} 
                email={user.email}
            />
        )

    })
    return (
        <div>
            {cardComponent}
        </div>
    );
}

export default CardList;
